angular.module("boilerplate-templates",[]).run(["$templateCache",function($templateCache){$templateCache.put("app/components/index/index.html",'<h1>Lista de casamento</h1>\n<div class="pre-text">\n    <p>\n        Para todos aqueles que nos perguntaram pela lista de casamento, aqui ficam as possibilidades:\n    </p>\n\n    <li style="padding-bottom: 10px">Nesta página, mais abaixo, podem escolher uma prenda que queiram oferecer e escolher dar a totalidade ou uma parte da mesma.\n    Só precisam de escolher a opção que querem e depois fazer a transferência para uma das contas abaixo:\n\n    <p style="text-align: center; font-weight: bold">\n        IBAN Ana: PT50 0010 0000 4815 1710 0017 1\n    </p>\n    <p style="text-align: center; font-weight: bold">\n        IBAN André: PT50 0010 0000 3075 5330 0018 4\n    </p>\n        </li>\n\n    <li style="padding-bottom: 10px">Além das prendas listadas aqui, na página da loja "A Luísa" poderão também encontrar a lista com artigos escolhidos por nós.\n\n    Para entrar basta <a href="http://www.aluisa.pt/index.php?a-nossa-lista&sc=lista" style="text-decoration: underline" target="_blank">clicar aqui</a> e colocar os seguintes dados na secção convidados:\n\n\n        <p style="text-align: center; font-weight: bold">\n            Número: 32\n        </p>\n        <p style="text-align: center; font-weight: bold">\n            Código: 8w89v4\n        </p>\n    </li>\n    <p>\n        <li style="padding-bottom: 10px">\n        Podem também entrar em <a href="http://aluisa.pt/?contactos&cod=182&subCat=182" style="text-decoration: underline" target="_blank">contacto directo</a> com a loja ou ir lá ver as peças na loja, em Vila do Conde atrás do tribunal.\n        </li>\n    </p>\n</div>\n<!--<div class="dados">\n    <label>\n        Nome:\n        <input ng-model="user.name">\n    </label>\n    <span class="spandex"></span>\n</div>-->\n<div class="filters" id="lista">\n    <label>\n        Ordenar por:\n    </label>\n    <select class="selector" ng-model=\'sort\'>\n        <option value="name">Nome</option>\n        <option value="-price">Preço(Maior para o Menor)</option>\n        <option value="price">Preço(Menor para o Maior)</option>\n    </select>\n    <span class="spandex"></span>\n</div>\n<div class="wrapper" >\n    <div class="product" status="{{product.status}}" ng-repeat=\'product in products | orderBy:sort\'>\n\n        <a ng-if="product.store" href="http://www.aluisa.pt/index.php?a-nossa-lista&sc=lista" target="_blank">\n            <div class="storedivplace">\n                <img src="img/luisa.png">\n            </div>\n        </a>\n        <a href="{{product.store ? product.url : product.image}}" class="fancybox hover-effect" data-fancybox-group="group" target="_blank">\n            <section class="image" ng-class=\'product.position\' ng-style=\'{\n            "background-image": "url(" + product.image + ")"\n        }\'></section>\n        </a>\n        <section class="content" ng-init="product.count = 1">\n            <p ng-if="product.status == \'u\'">\n                {{product.quantity}}  {{product.name}}\n            </p>\n            <p ng-if="product.status == \'a\'">\n                {{product.name}}\n            </p>\n            <p>\n                <span  ng-if="product.quantity > 0 && product.status == \'a\'">\n                    Quantidade a oferecer:\n                <select ng-model="product.count" ng-options="item for item in buildArray(product.quantity)"></select>\n                </span>\n                <strong ng-if="!product.quantity" class="price">{{product.price}} €</strong>\n                <strong ng-if="product.quantity && product.status == \'u\'" class="price">{{product.quantity * product.price}} €</strong>\n            </p>\n            <span ng-if="product.status == \'u\'">\n                <button style="width: 98%">\n                    Já oferecido\n                </button>\n            </span>\n            <span ng-if="product.quantity > 0 && product.status == \'a\'">\n                <a target="_blank"\n                   href="https://docs.google.com/forms/d/10XmBsR-8gFjEAsBVPIwD99skZOwGdrDRkBa_d9-aUmE/formResponse?ifq&entry.391008835={{product.name}}&entry.501605697={{product.price*product.count}}&entry.19109304=Total&submit=Submit">\n                    <button style="width: 98%">\n                        Oferecer  <strong>{{product.price * product.count}} € </strong>\n                    </button>\n                </a>\n            </span>\n            <div\n                ng-if="!product.quantity  && product.status == \'a\'"\n                >\n                <a target="_blank"\n                   href="https://docs.google.com/forms/d/10XmBsR-8gFjEAsBVPIwD99skZOwGdrDRkBa_d9-aUmE/formResponse?ifq&entry.391008835={{product.name}}&entry.501605697={{product.price}}&entry.19109304=Parcial&submit=Submit">\n                    <button>\n                        Oferecer uma parte\n                    </button>\n                </a>\n                <a target="_blank"\n                   href="https://docs.google.com/forms/d/10XmBsR-8gFjEAsBVPIwD99skZOwGdrDRkBa_d9-aUmE/formResponse?ifq&entry.391008835={{product.name}}&entry.501605697={{product.price}}&entry.19109304=Total&submit=Submit">\n                    <button>\n                        Oferecer total\n                    </button>\n                </a>\n            </div>\n        </section>\n    </div>\n\n</div>')}]);